import React from 'react';
import './work.css';

function Work(props) {
    const work = props.data;
    const listWorks = work.map((item, i)=>
         <div className ="ListWork" key = {i} >
            <div className="Position">
                <div className="box_1">
                    {item.position.toUpperCase()}
                </div>
                <div className="box_2">
                    {item.fe_desde} - {item.fe_hasta}
                </div>
            </div>
            <div className = "Company">
                {item.company.toUpperCase()} 
            </div>
            <div className = "Description">
                {item.description}
            </div>
            <hr></hr>
         </div>
    )
    return (
        <div className="Work">
            <div className ="subtitle">
                <span>EXPERIENCIA</span>
                <hr></hr>
            </div>
            {listWorks}
        </div>
    )
}

export default Work;
